import React from 'react';

// import '../css/app.css';

const Contact = ({key,name , phone,email, image}) => {
	return(
		<div className="ui card">
			<div className="content">
				<img className="right floated mini ui image" src={image} alt="photo"></img>
					<div className="header">
						{name}
					</div>
					<div className="meta">
					{email}
					</div>
				<div className="description">
					{phone}
				</div>
			</div>
		</div>
		);
}
 


export default Contact;
